import './style.scss';
import React, { Component } from 'react';
import faker from 'faker';
class Footer extends Component {
  render(){
    return(
      <footer>
        <div> Footer component</div>
        <image src={faker.image.avatar()} />
      </footer>
    )
  }
}

export default Footer;
